import React from "react";
import { ReactComponent as Logo } from "../logo.svg";

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-secondary">
      <div className="container">
        <a className="navbar-brand d-flex align-items-center" href="/">
          <Logo width={40} height={40} className="me-2" />
          <span>Mirarestorasyon</span>
        </a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><a className="nav-link active" href="#">Ana Sayfa</a></li>
            <li className="nav-item"><a className="nav-link" href="#hizmetler">Hizmetler</a></li>
            <li className="nav-item"><a className="nav-link" href="#iletisim">İletişim</a></li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
